/**
 * aams_session			string	AAMS session ID
 * aams_ticket			string	AAMS ticket ID
 * aams_session_label		string	AAMS session label to be displayed on the game
 * aams_ticket_label		string	AAMS session label to be displayed on the game
 * aams_show_session		bool	        Flag to toggle the visibility of AAMS session ID
 * aams_show_ticket		bool	        Flag to toggle the visibility of AAMS ticket ID
 * aams_URL			string	URL to AAMS page
 * aams_responsible_URL	string	URL to responsible gaming page
 */
export interface IAdditionalInfoData {
    aams_session: string;
    aams_ticket: string;
    aams_session_label: string;
    aams_ticket_label: string;
    aams_show_session: boolean;
    aams_show_ticket: boolean;
    aams_URL: string;
    aams_responsible_URL: string;
}
